    false,nt"url": null,nt"notes": "This narrative report for Hazen Bay National
    Wildlife Refuge and Nunivak National Wildlife Refuge outlines Refuge accomplishments
    from January through April of 1953. The report begins by summarizing the weather
    conditions and water conditions during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, and
    fish- is also covered. The Refuge development and maintenance section discusses
    collections and receipts. The public relations section of the report describes Refuge
    visitors and Refuge participation. Photographs are attached.",nt"license_title":
